interface IMainReducer {
  test: string;
}

export const InitialMainReducer: IMainReducer = {
  test: ''
};

export const main: any = (
  state: IMainReducer = InitialMainReducer,
  action: string
) => {
  switch (action) {
    case 'SHOW_ALL':
      return InitialMainReducer;
    case 'SHOW_COMPLETED':
      return InitialMainReducer;
    case 'SHOW_ACTIVE':
      return InitialMainReducer;
  }
  // return InitialMainReducer;
};
